// frontend/src/Components/Results.js
import React, { useState, useEffect } from 'react';
import { LineChart, Line, XAxis, YAxis, CartesianGrid, Tooltip, Legend, ResponsiveContainer } from 'recharts';
import './Results.css';

const Results = ({ identifiedInstrument }) => {
    const [showDetails, setShowDetails] = useState(false);
    const [spectrogramData, setSpectrogramData] = useState(null);
    const [comparativeData, setComparativeData] = useState(null);
    const [activeTab, setActiveTab] = useState('accuracy');
    const [animationProgress, setAnimationProgress] = useState(0);
    const [spectrogramScale, setSpectrogramScale] = useState(1);
    const [spectrogramColor, setSpectrogramColor] = useState('grayscale');
    const [spectrogramFrequency, setSpectrogramFrequency] = useState('mid');
    const [spectrogramTime, setSpectrogramTime] = useState(0);
    const [geographicData, setGeographicData] = useState(null);
    const [historicalData, setHistoricalData] = useState(null);

    useEffect(() => {
        fetchSpectrogramData();
        fetchComparativeData();
        fetchGeographicData();
        fetchHistoricalData();
        const timer = setInterval(() => {
            setAnimationProgress((oldProgress) => {
                if (oldProgress === 100) {
                    clearInterval(timer);
                    return 100;
                }
                return Math.min(oldProgress + 1, 100);
            });
        }, 20);
        return () => clearInterval(timer);
    }, []);

    const toggleDetails = () => {
        setShowDetails(!showDetails);
    };

    const fetchSpectrogramData = async () => {
        // Simulated API call
        setTimeout(() => {
            setSpectrogramData('data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAEAAAABCAYAAAAfFcSJAAAACklEQVR4nGMAAQAABQABDQottAAAAABJRU5ErkJggg==');
        }, 1500);
    };

    const fetchComparativeData = async () => {
        // Simulated API call
        setTimeout(() => {
            setComparativeData([
                { name: 'Quena', ML: 85, tradicional: 70 },
                { name: 'Bombo', ML: 78, tradicional: 85 },
                { name: 'Charango', ML: 92, tradicional: 88 },
                { name: 'Zampoña', ML: 88, tradicional: 75 },
            ]);
        }, 1500);
    };

    const fetchGeographicData = async () => {
        // Simulated API call
        setTimeout(() => {
            setGeographicData([
                { region: 'Andes', percentage: 70 },
                { region: 'Amazon', percentage: 15 },
                { region: 'Coast', percentage: 10 },
                { region: 'Other', percentage: 5 },
            ]);
        }, 1500);
    };

    const fetchHistoricalData = async () => {
        // Simulated API call
        setTimeout(() => {
            setHistoricalData([
                { year: 1500, usage: 20 },
                { year: 1700, usage: 40 },
                { year: 1900, usage: 60 },
                { year: 2000, usage: 80 },
                { year: 2023, usage: 100 },
            ]);
        }, 1500);
    };

    const handleFrequencyChange = (freq) => {
        setSpectrogramFrequency(freq);
    };

    const handleTimeChange = (event) => {
        setSpectrogramTime(event.target.value);
    };

    const instruments = [
        { name: 'Quena', accuracy: 85 },
        { name: 'Bombo', accuracy: 78 },
        { name: 'Charango', accuracy: 92 },
        { name: 'Zampoña', accuracy: 88 },
    ];

    return (
        <div className="results">
            <h3>Resultados del Análisis</h3>
            <div className="progress-bar">
                <div className="progress" style={{ width: `${animationProgress}%` }}></div>
            </div>
            <div className="tabs">
                <button className={activeTab === 'accuracy' ? 'active' : ''} onClick={() => setActiveTab('accuracy')}>Precisión</button>
                <button className={activeTab === 'spectrogram' ? 'active' : ''} onClick={() => setActiveTab('spectrogram')}>Espectrograma</button>
                <button className={activeTab === 'comparative' ? 'active' : ''} onClick={() => setActiveTab('comparative')}>Análisis Comparativo</button>
                <button className={activeTab === 'geographic' ? 'active' : ''} onClick={() => setActiveTab('geographic')}>Distribución Geográfica</button>
                <button className={activeTab === 'timeline' ? 'active' : ''} onClick={() => setActiveTab('timeline')}>Línea de Tiempo</button>
            </div>
            {activeTab === 'accuracy' && (
                <div className="accuracy-content">
                    <div className="graph-container">
                        <ResponsiveContainer width="100%" height={300}>
                            <LineChart data={instruments}>
                                <CartesianGrid strokeDasharray="3 3" />
                                <XAxis dataKey="name" />
                                <YAxis />
                                <Tooltip />
                                <Legend />
                                <Line type="monotone" dataKey="accuracy" stroke="#8884d8" activeDot={{ r: 8 }} />
                            </LineChart>
                        </ResponsiveContainer>
                    </div>
                    <ul className="instrument-list">
                        {instruments.map((instrument) => (
                            <li key={instrument.name}>
                                <span className="instrument">{instrument.name}:</span>
                                <div className="accuracy-bar">
                                    <div className="accuracy-fill" style={{ width: `${instrument.accuracy}%` }}></div>
                                    <span className="accuracy-text">{instrument.accuracy}%</span>
                                </div>
                            </li>
                        ))}
                    </ul>
                </div>
            )}
            {activeTab === 'spectrogram' && (
                <div className="spectrogram">
                    <h4>Espectrograma</h4>
                    <div className="spectrogram-controls">
                        <button onClick={() => handleFrequencyChange('low')}>Frecuencias Bajas</button>
                        <button onClick={() => handleFrequencyChange('mid')}>Frecuencias Medias</button>
                        <button onClick={() => handleFrequencyChange('high')}>Frecuencias Altas</button>
                    </div>
                    <input
                        type="range"
                        min="0"
                        max="100"
                        value={spectrogramTime}
                        onChange={handleTimeChange}
                    />
                    <svg className="spectrogram-svg">
                        <rect x="0" y="0" width="100%" height="100%" fill="rgba(255,255,255,0.1)" />
                        <text x="50%" y="50%" textAnchor="middle" fill="#FFD700">
                            Espectrograma: {spectrogramFrequency} freq, tiempo: {spectrogramTime}
                        </text>
                    </svg>
                </div>
            )}
            {activeTab === 'comparative' && (
                <div className="comparative-analysis">
                    <h4>Análisis Comparativo</h4>
                    {comparativeData ? (
                        <ResponsiveContainer width="100%" height={300}>
                            <LineChart data={comparativeData}>
                                <CartesianGrid strokeDasharray="3 3" />
                                <XAxis dataKey="name" />
                                <YAxis />
                                <Tooltip />
                                <Legend />
                                <Line type="monotone" dataKey="ML" stroke="#8884d8" activeDot={{ r: 8 }} />
                                <Line type="monotone" dataKey="tradicional" stroke="#82ca9d" />
                            </LineChart>
                        </ResponsiveContainer>
                    ) : (
                        <div className="loading">Cargando análisis comparativo...</div>
                    )}
                </div>
            )}
            {activeTab === 'geographic' && (
                <div className="geographic-distribution">
                    <h4>Distribución Geográfica</h4>
                    {geographicData ? (
                        <ResponsiveContainer width="100%" height="100%">
                            <LineChart data={geographicData}>
                                <CartesianGrid strokeDasharray="3 3" />
                                <XAxis dataKey="region" />
                                <YAxis />
                                <Tooltip />
                                <Legend />
                                <Line type="monotone" dataKey="percentage" stroke="#8884d8" />
                            </LineChart>
                        </ResponsiveContainer>
                    ) : (
                        <div className="loading">Cargando datos geográficos...</div>
                    )}
                </div>
            )}
            {activeTab === 'timeline' && (
                <div className="historical-timeline">
                    <h4>Línea de Tiempo Histórica</h4>
                    {historicalData ? (
                        <ResponsiveContainer width="100%" height="100%">
                            <LineChart data={historicalData}>
                                <CartesianGrid strokeDasharray="3 3" />
                                <XAxis dataKey="year" />
                                <YAxis />
                                <Tooltip />
                                <Legend />
                                <Line type="monotone" dataKey="usage" stroke="#82ca9d" />
                            </LineChart>
                        </ResponsiveContainer>
                    ) : (
                        <div className="loading">Cargando datos históricos...</div>
                    )}
                </div>
            )}
            <button onClick={toggleDetails}>
                {showDetails ? 'Ocultar Detalles' : 'Mostrar Detalles'}
            </button>
            {showDetails && (
                <div className="details-container">
                    <p>Detalles sobre la precisión y el análisis de los instrumentos identificados...</p>
                </div>
            )}
        </div>
    );
};

export default Results;
